-- Average Weight per Lift

SELECT 
	AVG(lifts.weight_lbs) AS avg_weight_lbs, 
	exercise.exercise_name 
FROM gains.lifts
	INNER JOIN gains.exercise
ON lifts.exercise_id = exercise.exercise_id
GROUP BY exercise.exercise_name

