-- Total count for each category type 
SELECT 
    COUNT( CASE 
        WHEN categories.category_id = '1' THEN 1
        WHEN categories.category_id = '2' THEN 1
        WHEN categories.category_id = '3' THEN 1
        END
        ) AS category_count,
     categories.category_name
FROM gains.exercise
LEFT JOIN gains.categories
ON exercise.category_id = categories.category_id
LEFT JOIN gains.lifts
ON exercise.exercise_id = lifts.exercise_id
GROUP BY categories.category_name
ORDER BY categories.category_name

